import React from "react";
import brushstroke from '../img/brushstroke.png';
import "./styles/Slideshow.css";


function Slideshow() {
    return (
      <>

      <img className="brushstroke" src={brushstroke} alt="brushstroke"/>

      </>
    );
  }

  export default Slideshow;
